def minimize_total_coins(P, N):
    price = [2, 5, 10, 50, 100, 500]
    ans = float('inf')
    p_sum = sum(map(lambda s: s[0] * s[1], zip(price, N)))
    for change in range(1000):
        total = P + change
        pay = [0] * 6
        for i in reversed(range(6)):
            if total >= price[i]:
                pay[i] = min(N[i], int(total / price[i]))
                total -= pay[i] * price[i]
        if total > 0:
            break
        coins = sum(pay)
        _change = change
        for i in reversed(range(6)):
            if _change >= price[i]:
                coins += int(_change / price[i])
                _change %= price[i]
        ans = min(ans, coins)
    return ans

